import React from 'react';
import Button from '@material-ui/core/Button';
const Creatematch = () =>
{

    return <>
        <form>
            <input type='text' placeholder='title' autocomplete='off'></input>
            <textarea rows="" column="" palceholder="input maar"/>
            <Button></Button>
        </form>
    </>
       
} ;
export default Creatematch;
